// OrderTable.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const OrderTable = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    // Fetch order data from the backend
    axios.get('/api/orders') // Replace with your backend API route
      .then(response => {
        setOrders(response.data); // Assuming data is an array of order objects
      })
      .catch(error => {
        console.error('Error fetching order data:', error);
      });
  }, []);

  return (
    <div>
      <h2>Order List</h2>
      <table className="min-w-full table-auto border-collapse">
        <thead>
          <tr>
            <th className="px-4 py-2 border">Order ID</th>
            <th className="px-4 py-2 border">Customer</th>
            <th className="px-4 py-2 border">Status</th>
            <th className="px-4 py-2 border">Total</th>
          </tr>
        </thead>
        <tbody>
          {orders.length === 0 ? (
            <tr>
              <td colSpan="4" className="text-center py-2">No orders found</td>
            </tr>
          ) : (
            orders.map(order => (
              <tr key={order._id}>
                <td className="px-4 py-2 border">{order.orderId}</td>
                <td className="px-4 py-2 border">{order.customerName}</td>
                <td className="px-4 py-2 border">{order.status}</td>
                <td className="px-4 py-2 border">${order.total}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default OrderTable;
